import Hamburger from './Menu';
import './Header.css';
import logo from './solana-sol-logo.svg';

function Header() {
  return (
    <div className="Header">
        <div id="logo">
            <img src={logo} className="Sol-logo" height="30" width="30" alt="logo" />
        </div>
        <Menu />
    </div>
  );
}

export default Header;
